import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import {
  Budget,
  Inventory,
  Reports,
  Recipes,
  Orders,
  Goals,
  Dashboard
} from './pages';
import { Ref, Grid, Segment } from 'semantic-ui-react';
import { Sidenav } from './components';
import 'semantic-ui-css/semantic.min.css';


const App = () => {
  const segmentRef = React.useRef();

  return (
    <Grid columns={1}>
      <Router>
       
          <Sidenav />
         
              <Switch>
                <Route exact path='/dashboard'>
                  <Dashboard />
                </Route>
                <Route path='/budget'>
                  <Budget />
                </Route>
                <Route path='/inventory'>
                  <Inventory />
                </Route>
                <Route path='/reports'>
                  <Reports />
                </Route>
                <Route path='/recipes'>
                  <Recipes />
                </Route>
                <Route path='/orders'>
                  <Orders />
                </Route>
                <Route path='/goals'>
                  <Goals />
                </Route>
              </Switch>
          
      </Router>
     
    </Grid>
    
  )
}

export default App;
